@teal.poppy so intention is EVERYTHING. And deprogramming/reprogramming doesn’t only happen in the meditative state. That just helps your clear space and identify negative programming. 

Positive affirmations are huge, using present tense language about who you want to become(who your are), repeatedly writing something down, mantras, reframing negative beliefs / systems, gratitude meditations, guided meditations etc. 

There’s so many to list. I definitely have videos coming up on it
